import './App.css';
import Navbar from './component/Navbar';
import Home from './component/Home';
import Products from './component/Products';
import {Switch, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <Switch>
      <Navbar/>
      <Home/>
      <Products/>
    </Switch>
    </div>
  );
}

export default App;
